using System;
using UnityEditor;
using UnityEngine;

[ExecuteInEditMode]
public class CarPaintColor : ShaderGUI {

    Texture2D t;
    bool isLoaded = false;
    Color normalColor = new Color(0.76f, 0.76f, 0.76f);
    Color highlightColor = Color.white;

    public override void OnGUI(MaterialEditor materialEditor, MaterialProperty[] properties) {
        if (!isLoaded) {
            string str = "";
            byte[] bytes = Convert.FromBase64String(str);
            t = new Texture2D(1, 1);
            t.LoadImage(bytes);
            isLoaded = true;
        }
        GUI.DrawTexture(new Rect(0, 0, EditorGUIUtility.currentViewWidth, 80), t, ScaleMode.StretchToFill, true, 2.0f);
        GUILayout.Space(80);
        MaterialProperty _Color = ShaderGUI.FindProperty("_Color", properties);
        materialEditor.ShaderProperty(_Color, _Color.displayName);
        MaterialProperty _Smoothness = ShaderGUI.FindProperty("_Smoothness", properties);
        materialEditor.ShaderProperty(_Smoothness, _Smoothness.displayName);
        MaterialProperty _Metallic = ShaderGUI.FindProperty("_Metallic", properties);
        materialEditor.ShaderProperty(_Metallic, _Metallic.displayName);
        MaterialProperty _Occlusion = ShaderGUI.FindProperty("_Occlusion", properties);
        materialEditor.ShaderProperty(_Occlusion, _Occlusion.displayName);
        MaterialProperty _OcclusionPower = ShaderGUI.FindProperty("_OcclusionPower", properties);
        materialEditor.ShaderProperty(_OcclusionPower, _OcclusionPower.displayName);
        GUILayout.Space(5);
        HorizontalLine(Color.gray);


        MaterialProperty _EnableFlakes = ShaderGUI.FindProperty("_EnableFlakes", properties);
        GUI.color = (_EnableFlakes.floatValue == 1) ? highlightColor : normalColor;
        materialEditor.ShaderProperty(_EnableFlakes, _EnableFlakes.displayName);
        if (_EnableFlakes.floatValue == 1) {
            MaterialProperty _Flakes = ShaderGUI.FindProperty("_Flakes", properties);
            MaterialProperty _FlakesTint = ShaderGUI.FindProperty("_FlakesTint", properties);
            MaterialProperty _FlakesIntensity = ShaderGUI.FindProperty("_FlakesIntensity", properties);
            materialEditor.ShaderProperty(_Flakes, _Flakes.displayName);
            materialEditor.ShaderProperty(_FlakesTint, _FlakesTint.displayName);
            materialEditor.ShaderProperty(_FlakesIntensity, _FlakesIntensity.displayName);
            GUILayout.Space(5);
            HorizontalLine(Color.gray);
        }

        MaterialProperty _EnableCube = ShaderGUI.FindProperty("_EnableCube", properties);
        GUI.color = (_EnableCube.floatValue == 1) ? highlightColor : normalColor;
        materialEditor.ShaderProperty(_EnableCube, _EnableCube.displayName);
        if (_EnableCube.floatValue == 1) {
            MaterialProperty _Cube = ShaderGUI.FindProperty("_Cube", properties);
            MaterialProperty _CubeTint = ShaderGUI.FindProperty("_CubeTint", properties);
            MaterialProperty _CubeIntensity = ShaderGUI.FindProperty("_CubeIntensity", properties);
            MaterialProperty _Fresnel = ShaderGUI.FindProperty("_Fresnel", properties);
            materialEditor.ShaderProperty(_Cube, _Cube.displayName);
            materialEditor.ShaderProperty(_CubeTint, _CubeTint.displayName);
            materialEditor.ShaderProperty(_CubeIntensity, _CubeIntensity.displayName);
            materialEditor.ShaderProperty(_Fresnel, _Fresnel.displayName);
            GUILayout.Space(5);
            HorizontalLine(Color.gray);
        }

        MaterialProperty _EnableRim = ShaderGUI.FindProperty("_EnableRim", properties);
        GUI.color = (_EnableRim.floatValue == 1) ? highlightColor : normalColor;
        materialEditor.ShaderProperty(_EnableRim, _EnableRim.displayName);
        if (_EnableRim.floatValue == 1) {
            MaterialProperty _RimColor = ShaderGUI.FindProperty("_RimColor", properties);
            MaterialProperty _RimAmount = ShaderGUI.FindProperty("_RimAmount", properties);
            MaterialProperty _RimPower = ShaderGUI.FindProperty("_RimPower", properties);
            materialEditor.ShaderProperty(_RimColor, _RimColor.displayName);
            materialEditor.ShaderProperty(_RimAmount, _RimAmount.displayName);
            materialEditor.ShaderProperty(_RimPower, _RimPower.displayName);
        }
    }

    // utility method
    static void HorizontalLine(Color color) {
        GUIStyle horizontalLine;
        horizontalLine = new GUIStyle();
        horizontalLine.normal.background = EditorGUIUtility.whiteTexture;
        horizontalLine.margin = new RectOffset(0, 0, 4, 4);
        horizontalLine.fixedHeight = 1;
        var c = GUI.color;
        GUI.color = color;
        GUILayout.Box(GUIContent.none, horizontalLine);
        GUI.color = c;
    }
}